## Remarks  
 すべてのイベント データ (トレースまたはデバッグ) ソース イベントは、文字列として ETW サブシステムに書き込まれます。 データ要素では、コンマを使用して区切られます。 別の区切り記号を指定するには、使用、<xref:System.Diagnostics.Eventing.EventProviderTraceListener.Delimiter%2A>プロパティです。  
  
 リスナーを追加する<xref:System.Diagnostics.TraceSource?displayProperty=nameWithType>ETW サブシステムにプロバイダーを登録します。 ログ ファイルに、イベントを書き込めません Logman.exe 実行可能プログラム (またはような) を使用して ETW トレース セッションを作成する必要があります。  
  
 イベント データが 1 つの文字列であるためにリスナーからのイベントを処理するためにマニフェストは不要です。  
  
 呼び出すと、<xref:System.Diagnostics.TraceSource?displayProperty=nameWithType>書き込むイベントを渡す方法、<xref:System.Diagnostics.TraceEventType?displayProperty=nameWithType>列挙値。 列挙には、レベルとキーワードの両方の値が含まれています。 指定したレベルの値が、次のいずれかに関連付けられている値を指定できます、ETW セッションからのトレース リスナー プロバイダーを有効にすると<xref:System.Diagnostics.TraceEventType?displayProperty=nameWithType>列挙値。  
  
-   重要な (値は 1)  
  
-   エラー (値は 2)  
  
-   情報 (値は 8)  
  
-   詳細 (値は 16)  
  
-   警告 (値は 4)  
  
 セッションは、次のいずれかに関連付けられている値を指定できます用に指定したキーワード値<xref:System.Diagnostics.TraceEventType?displayProperty=nameWithType>列挙値。  
  
-   再開 (値は 2,048)  
  
-   開始 (値は 256)  
  
-   停止 (値は 512)  
  
-   中断 (値は 1,024)  
  
-   転送 (値は 4,096)  
  
   
  
## Examples  
  
```  
private static Guid providerId = new Guid("{B3F0C8FC-E8A8-4868-8901-1465E8A2F41B}");  
  
    EventProviderTraceListener listener = new EventProviderTraceListener(providerId.ToString(), "Test Listener", "::");  
  
    // You should use the All default level and control the level using the  
    // ETW session; otherwise, you may not log all the events requested by the  
    // session.  
    TraceSource source = new TraceSource("MyProvider", SourceLevels.All);  
  
    source.Listeners.Add(listener);  
  
    source.TraceData(TraceEventType.Warning | TraceEventType.Start, 2, new object[] { "abc", "def", true, 123 });  
  
    source.TraceEvent(TraceEventType.Warning, 12, "Provider guid: {0}", new object[] { providerId });  
  
    source.TraceInformation("string {0}, bool {1}, int {2}, ushort {3}", new object[] { "abc", false, 123, (UInt32)5 });  
```
